import React from 'react';
import logo from './logo.svg';
import './App.css';
import $ from 'jquery';

$("#searchartists").submit(function(e) {
  alert('submit');
  e.preventDefault();
  $.ajax({
    url: 'http://ws.audioscrobbler.com/2.0/?method=artist.search&artist=cher&api_key=278b674c37ebf25ee302d1bc7edb0b76&format=json',
    success: function(data) {
      alert(data.artist.name);
    },
    error: function(error){
      alert(error);
    }
  })
});


function App() {
  return (
      <div className="App">

    </div>
  );
}

export default App;
